import DataFilm from "../data/Film-Apple-data";

function FilmApple(){
    const listeFilm = DataFilm.map((Element) =>
        <div key={Element.titre} className={Element.class}>Salut</div>
    )
    return(
        <div>{listeFilm}</div>
    )
}

export default FilmApple
